import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity, Image } from 'react-native';
import { useSelector } from 'react-redux';
import Button from '../../components/common/Button';
import TarotCard from '../../components/cards/TarotCard';
import TarotCard3D from '../../components/3d/TarotCard3D';

const SpreadDetailScreen = ({ route, navigation }) => {
  const { spreadId } = route.params;
  const [spread, setSpread] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [use3D, setUse3D] = useState(false);

  const spreads = useSelector(state => state.tarot.spreads);

  useEffect(() => {
    // Find the spread from Redux store
    const foundSpread = spreads.find(s => s.id === spreadId);
    if (foundSpread) {
      setSpread(foundSpread);
    } else {
      setError('Spread not found');
    }
    setLoading(false);
  }, [spreadId, spreads]);

  const handleStartReading = () => {
    navigation.navigate('ReadingResult', { spreadId: spreadId });
  };

  if (loading) {
    return (
      <View style={styles.loadingContainer}>
        <Text style={styles.loadingText}>Loading spread details...</Text>
      </View>
    );
  }

  if (error || !spread) {
    return (
      <View style={styles.errorContainer}>
        <Text style={styles.errorText}>{error || 'Spread not found'}</Text>
        <Button 
          title="Go Back" 
          onPress={() => navigation.goBack()} 
          type="secondary"
        />
      </View>
    );
  }

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <Text style={styles.title}>{spread.name}</Text>

      <View style={styles.descriptionContainer}>
        <Text style={styles.description}>{spread.description}</Text>
      </View>

      <View style={styles.detailsContainer}>
        <Text style={styles.detailsTitle}>Spread Details</Text>
        <Text style={styles.detailsText}>
          Number of cards: {spread.layout.positions.length}
        </Text>
        <Text style={styles.detailsText}>
          Difficulty: {spread.is_premium ? 'Advanced' : 'Beginner'}
        </Text>
        <Text style={styles.detailsText}>
          Best for: {spread.id === '1' ? 'Quick insights and general guidance' : 
                    spread.id === '2' ? 'Complex situations requiring deep analysis' :
                    spread.id === '3' ? 'Relationship questions and dynamics' :
                    spread.id === '4' ? 'Career decisions and professional growth' :
                    'General guidance'}
        </Text>
      </View>

      <View style={styles.layoutContainer}>
        <Text style={styles.layoutTitle}>Card Layout</Text>

        {/* Simple visual representation of the spread layout */}
        <View style={styles.layoutVisual}>
          {spread.layout.positions.map((position) => (
            <View 
              key={position.id}
              style={[
                styles.positionMarker,
                {
                  left: `${position.x * 25 + 10}%`,
                  top: position.y * 60 + 10,
                  zIndex: position.overlay ? 2 : 1,
                  transform: position.overlay ? [{ rotate: '45deg' }] : []
                }
              ]}
            >
              <Text style={styles.positionNumber}>{position.id}</Text>
            </View>
          ))}
        </View>

        <View style={styles.positionsContainer}>
          {spread.layout.positions.map((position) => (
            <View key={position.id} style={styles.positionItem}>
              <Text style={styles.positionNumber}>{position.id}</Text>
              <Text style={styles.positionName}>{position.name}</Text>
            </View>
          ))}
        </View>
      </View>

      <View style={styles.cardPreviewContainer}>
        <Text style={styles.cardPreviewTitle}>Card Preview</Text>
        <View style={styles.cardPreview}>
          {use3D ? (
            <TarotCard3D 
              card={{
                name: "Sample Card",
                image: "m00.jpg",
                modern_interpretation: "This is a sample card for preview purposes."
              }}
              style={styles.previewCard}
            />
          ) : (
            <TarotCard 
              card={{
                name: "Sample Card",
                image: "m00.jpg",
                modern_interpretation: "This is a sample card for preview purposes."
              }}
              style={styles.previewCard}
            />
          )}
        </View>
        <Button 
          title={use3D ? "Switch to 2D" : "Switch to 3D"} 
          onPress={() => setUse3D(!use3D)} 
          type="outline"
          size="small"
          style={styles.switchButton}
        />
      </View>

      <View style={styles.startContainer}>
        <Text style={styles.startText}>
          Ready to begin your reading? Take a deep breath, focus on your question, and when you're ready, press the button below.
        </Text>
        <Button 
          title="Start Reading" 
          onPress={handleStartReading} 
          style={styles.startButton}
        />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    backgroundColor: '#FAF3E0',
    padding: 20,
  },
  loadingContainer: {
    flex: 1,
    backgroundColor: '#FAF3E0',
    justifyContent: 'center',
    alignItems: 'center',
  },
  loadingText: {
    fontSize: 16,
    color: '#9B59B6',
    fontStyle: 'italic',
  },
  errorContainer: {
    flex: 1,
    backgroundColor: '#FAF3E0',
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  errorText: {
    fontSize: 16,
    color: '#E74C3C',
    textAlign: 'center',
    marginBottom: 20,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginTop: 40,
    marginBottom: 20,
    textAlign: 'center',
  },
  descriptionContainer: {
    backgroundColor: '#FFFFFF',
    borderRadius: 10,
    padding: 15,
    marginBottom: 20,
    borderWidth: 1,
    borderColor: '#E0D4C0',
  },
  description: {
    fontSize: 16,
    color: '#4A4A4A',
    lineHeight: 24,
  },
  detailsContainer: {
    marginBottom: 20,
  },
  detailsTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginBottom: 10,
  },
  detailsText: {
    fontSize: 16,
    color: '#4A4A4A',
    marginBottom: 5,
  },
  layoutContainer: {
    marginBottom: 30,
  },
  layoutTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginBottom: 15,
  },
  layoutVisual: {
    height: 200,
    backgroundColor: '#FFFFFF',
    borderRadius: 10,
    marginBottom: 15,
    position: 'relative',
    borderWidth: 1,
    borderColor: '#E0D4C0',
  },
  positionMarker: {
    position: 'absolute',
    width: 30,
    height: 45,
    backgroundColor: '#F0E6D2',
    borderRadius: 5,
    justifyContent: 'center',
    alignItems: 'center',
    borderWidth: 1,
    borderColor: '#9B59B6',
  },
  positionsContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'flex-start',
  },
  positionItem: {
    flexDirection: 'row',
    alignItems: 'center',
    width: '50%',
    marginBottom: 10,
  },
  positionNumber: {
    width: 24,
    height: 24,
    borderRadius: 12,
    backgroundColor: '#9B59B6',
    color: '#FFFFFF',
    textAlign: 'center',
    lineHeight: 24,
    marginRight: 10,
    fontWeight: 'bold',
  },
  positionName: {
    fontSize: 16,
    color: '#4A4A4A',
  },
  cardPreviewContainer: {
    alignItems: 'center',
    marginBottom: 30,
  },
  cardPreviewTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#9B59B6',
    marginBottom: 15,
    alignSelf: 'flex-start',
  },
  cardPreview: {
    alignItems: 'center',
    justifyContent: 'center',
    marginBottom: 15,
  },
  previewCard: {
    width: 200,
    height: 300,
  },
  switchButton: {
    marginTop: 10,
  },
  startContainer: {
    backgroundColor: '#F0E6D2',
    borderRadius: 10,
    padding: 20,
    marginBottom: 40,
    alignItems: 'center',
  },
  startText: {
    fontSize: 16,
    color: '#4A4A4A',
    textAlign: 'center',
    marginBottom: 20,
    lineHeight: 24,
  },
  startButton: {
    width: '80%',
  },
});

export default SpreadDetailScreen;
